import Layout from '../components/Layout';
import fetch from 'isomorphic-unfetch';
const Skills = (props) => {
    return (
        <Layout>
            <h1 style={{ textAlign:'center'}}>WELCOME TO SKILLS PAGE </h1>
            {props.descriptions.map((y)=>{
                return(
                       <ul style={{border:'solid', borderColor:'gray' , padding:'30px' , margin:'40px', listStyle:'none'}}>
                           <li> Id:{y.id}</li>
                           <li>User: {y.User}</li>
                           <li>skill_level: {y.skill_level}</li>
                           <li>Description : {y.description}</li>  
                       </ul>
                )
            })}
        </Layout>
    )
};
Skills.getInitialProps = async (props) => {
    let res, data, descriptions , skill_level ,User;
    try{
        res = await fetch('http://127.0.0.1:8000/api/v1/description/');
        data = await res.json();
        descriptions = data.objects
    } catch(error){
        console.error(error);
    }
    return {
        descriptions , skill_level,User
    }
};
export default Skills;
